import React from 'react';

import * as S from './PlanetStyles';
import * as GS from '../../pages/globalStyles';

const PlanetCard = ({ Name, Climate, Population, Films }) => {
  return (
    <GS.Main>
      <S.Planet>
        <S.Name>{Name}</S.Name>
        <S.List>
          <S.ListItem>
            <h5>Climate</h5>
            <span>{Climate}</span>
          </S.ListItem>
          <S.ListItem>
            <h5>Population</h5>
            <span>{Population}</span>
          </S.ListItem>
        </S.List>
      </S.Planet>
    </GS.Main>
  );
};

export default PlanetCard;
